%pyspark
from pyspark.sql.functions import *
from math import sin, cos, radians, acos
df = sqlContext.read.json("/shared/d/yg/Downloads/dataset/business.json")

df1 = df.select(explode("categories").alias("categories"),"latitude","longitude", "stars","city","name","review_count","business_id").orderBy("categories")
def dist(lat,long):
    if(lat is None or long is None):
        return 100;
    return acos(
        sin(radians(lat)) * sin(radians(43.6532)) + 
        cos(radians(lat)) * cos(radians(43.6532)) * 
        cos(radians(long) - radians(-79.3832))
    ) * 6371

from pyspark.sql.functions import udf
dist_udf = udf(dist)

df2=df1.select(dist_udf("latitude","longitude").alias("distance"),"stars","city","review_count","categories","name","business_id").orderBy("city")
